import './Header.css'
import logo from "../assets/image/header/logoCinemaGreen.png";
import ButtonHeader from '../shared/Button/ButtonHeader/ButtonHeader'

export function Header(){
    return(
        <section className="header">
            <img src={logo} alt="Логотип кинотеатра" className="logoCinema"/>
            <nav>
                
            </nav>
            <ButtonHeader>о кинотеатре</ButtonHeader>
            <ButtonHeader>цены</ButtonHeader>
            <ButtonHeader>контакты</ButtonHeader>
            <ButtonHeader>оставить отзыв</ButtonHeader>
        </section>
    )
}
